import React from 'react';
import { useNavigate } from 'react-router-dom';
import styles from './ScanProcessing.module.css';

function ScanProcessing() {
    const navigate = useNavigate();

    const goToSummary = () => {
      navigate('/scan-summary');
    };
    return (
      <div className={styles.container}>
        <div className={styles.card}>
          <img className={styles.cardimg} src='/logo.png' alt='TrackPeeK'></img>
                <h2 className={styles.heading}>TrackPeek</h2>
        <h2>Scanning....</h2>
        <button className={styles.pbtton} onClick={goToSummary}>Scan Summary</button>
      </div>
      </div>
    );
  }
  
  export default ScanProcessing;
